(56, 1, '2020-01-06 16:11:46', '2020-01-06 19:11:46', '<!-- wp:paragraph -->\n<p>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;h2&gt;A&nbsp;imponente&nbsp;sede&nbsp;do&nbsp;casarão&nbsp;foi&nbsp;construída&nbsp;em&nbsp;1860&lt;/h2&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;Fazenda&nbsp;Vila&nbsp;Rica&nbsp;desenvolveu-se&nbsp;durante&nbsp;o&nbsp;Ciclo&nbsp;do&nbsp;Café,&nbsp;na&nbsp;região&nbsp;de&nbsp;Itatiba,&nbsp;a&nbsp;apenas&nbsp;70&nbsp;Km&nbsp;de&nbsp;São&nbsp;Paulo.&nbsp;O&nbsp;paisagismo&nbsp;é&nbsp;a&nbsp;primeira&nbsp;surpresa&nbsp;de&nbsp;quem&nbsp;chega&nbsp;à&nbsp;Vila&nbsp;Rica.&nbsp;Ao&nbsp;se&nbsp;abrir&nbsp;a&nbsp;entrada&nbsp;principal&nbsp;da&nbsp;Fazenda,&nbsp;somos&nbsp;recebidos&nbsp;por&nbsp;uma&nbsp;alameda&nbsp;rodeada&nbsp;em&nbsp;toda&nbsp;sua&nbsp;extensão&nbsp;por&nbsp;um&nbsp;bosque&nbsp;de&nbsp;árvores,&nbsp;arbustos&nbsp;e&nbsp;vegetação&nbsp;rasteira&nbsp;autenticamente&nbsp;brasileira.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;imponente&nbsp;sede&nbsp;do&nbsp;casarão&nbsp;foi&nbsp;construída&nbsp;em&nbsp;1860,&nbsp;tem&nbsp;à&nbsp;sua&nbsp;frente&nbsp;um&nbsp;jardim&nbsp;margeando&nbsp;a&nbsp;piscina,&nbsp;e&nbsp;é&nbsp;rodeado&nbsp;por&nbsp;antigos&nbsp;terreiros&nbsp;para&nbsp;a&nbsp;secagem&nbsp;dos&nbsp;grãos&nbsp;de&nbsp;café,&nbsp;com&nbsp;majestosas&nbsp;palmeiras&nbsp;imperiais.&nbsp;Passeando&nbsp;por&nbsp;seus&nbsp;encantadores&nbsp;jardins&nbsp;encontramos&nbsp;uma&nbsp;autêntica&nbsp;capela&nbsp;colonial,&nbsp;estátuas&nbsp;e&nbsp;pórticos&nbsp;portugueses&nbsp;e&nbsp;italianos,&nbsp;trabalhos&nbsp;em&nbsp;pedras&nbsp;formando&nbsp;escadarias,&nbsp;muretas&nbsp;e&nbsp;alamedas&nbsp;que&nbsp;remontam&nbsp;a&nbsp;maneira&nbsp;de&nbsp;viver&nbsp;no&nbsp;auge&nbsp;do&nbsp;Ciclo&nbsp;do&nbsp;Café.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/p&gt;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;h2&gt;A&nbsp;Sede&nbsp;segue&nbsp;os&nbsp;parâmetros&nbsp;da&nbsp;arquitetura&nbsp;colonial&nbsp;portuguesa&lt;/h2&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Tendo&nbsp;sido&nbsp;construída&nbsp;a&nbsp;meia&nbsp;encosta,&nbsp;aproveitando&nbsp;o&nbsp;declive&nbsp;do&nbsp;terreno,&nbsp;com&nbsp;alicerce&nbsp;de&nbsp;pedra&nbsp;e&nbsp;paredes&nbsp;grossas&nbsp;de&nbsp;taipa&nbsp;de&nbsp;pilão&nbsp;e&nbsp;piso&nbsp;entre&nbsp;os&nbsp;andares&nbsp;de&nbsp;tábuas&nbsp;de&nbsp;cedro&nbsp;apoiadas&nbsp;em&nbsp;barrotes&nbsp;de&nbsp;peroba&nbsp;e&nbsp;teto&nbsp;com&nbsp;vigas&nbsp;de&nbsp;madeira.&nbsp;No&nbsp;andar&nbsp;inferior&nbsp;o&nbsp;porão&nbsp;era&nbsp;no&nbsp;século&nbsp;XIX&nbsp;um&nbsp;grande&nbsp;depósito&nbsp;usado&nbsp;para&nbsp;armazenagem&nbsp;de&nbsp;sacaria,&nbsp;utensílios&nbsp;de&nbsp;lavoura&nbsp;e&nbsp;como&nbsp;estábulo&nbsp;de&nbsp;animais,&nbsp;que&nbsp;ajudavam&nbsp;a&nbsp;aquecer&nbsp;os&nbsp;ambientes&nbsp;no&nbsp;inverno.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Sucessivas&nbsp;reformas&nbsp;foram&nbsp;feitas&nbsp;sempre&nbsp;respeitando&nbsp;a&nbsp;arquitetura&nbsp;original,&nbsp;conservando&nbsp;as&nbsp;fachadas&nbsp;externas,&nbsp;o&nbsp;piso&nbsp;em&nbsp;tábuas&nbsp;largas,&nbsp;assim&nbsp;como&nbsp;a&nbsp;caixilharia&nbsp;de&nbsp;madeira&nbsp;das&nbsp;janelas&nbsp;.&nbsp;A&nbsp;maior&nbsp;restauração&nbsp;da&nbsp;Sede&nbsp;foi&nbsp;feita&nbsp;na&nbsp;década&nbsp;de&nbsp;40,&nbsp;e&nbsp;abriu&nbsp;janelas&nbsp;onde&nbsp;antes&nbsp;eram&nbsp;alcovas,&nbsp;tendo&nbsp;sido&nbsp;contratado&nbsp;artesões&nbsp;italianos&nbsp;que&nbsp;fizeram&nbsp;pinturas&nbsp;nos&nbsp;forros&nbsp;e&nbsp;batentes.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;Sede,&nbsp;por&nbsp;si&nbsp;só,&nbsp;segreda&nbsp;maravilhas,&nbsp;muitas&nbsp;delas&nbsp;insondáveis&nbsp;ao&nbsp;visitante&nbsp;que&nbsp;chega&nbsp;distraído,&nbsp;mas&nbsp;os&nbsp;mistérios&nbsp;da&nbsp;Vila&nbsp;Rica&nbsp;acabam&nbsp;se&nbsp;revelando,&nbsp;seja&nbsp;num&nbsp;objeto,&nbsp;no&nbsp;aconchego&nbsp;de&nbsp;um&nbsp;ambiente,&nbsp;no&nbsp;passeio&nbsp;pelos&nbsp;arredores,&nbsp;na&nbsp;conversa&nbsp;junto&nbsp;à&nbsp;lareira.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Vastíssimo&nbsp;é&nbsp;o&nbsp;acervo&nbsp;da&nbsp;casa,&nbsp;embelezado&nbsp;por&nbsp;mobiliário&nbsp;dos&nbsp;séculos&nbsp;XVIII&nbsp;e&nbsp;XIX,&nbsp;como&nbsp;um&nbsp;arcaz&nbsp;em&nbsp;jacarandá,&nbsp;típico&nbsp;de&nbsp;sacristia&nbsp;de&nbsp;igrejas&nbsp;coloniais&nbsp;brasileiras,&nbsp;autênticas&nbsp;cadeiras&nbsp;entalhadas,&nbsp;aparelho&nbsp;de&nbsp;jantar&nbsp;Limoges,&nbsp;lustres&nbsp;franceses&nbsp;e&nbsp;quadros&nbsp;vitorianos.&nbsp;Junto&nbsp;à&nbsp;Sede&nbsp;há&nbsp;um&nbsp;sino&nbsp;brasonado&nbsp;com&nbsp;armas&nbsp;imperiais&nbsp;que&nbsp;era&nbsp;usado&nbsp;para&nbsp;anunciar&nbsp;as&nbsp;várias&nbsp;atividades&nbsp;do&nbsp;dia,&nbsp;missas,&nbsp;procissões&nbsp;e&nbsp;festas&nbsp;na&nbsp;colônia.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/p&gt;\n\n</p>\n<!-- /wp:paragraph -->', 'A Fazenda', '', 'inherit', 'closed', 'closed', '', '50-revision-v1', '', '', '2020-01-06 16:11:46', '2020-01-06 19:11:46', '', 50, 'http://localhost:8090/FRONTDEZ/vilarica/50-revision-v1/', 0, 'revision', '', 0);
