(89, 1, '2020-01-06 16:50:32', '2020-01-06 19:50:32', '<!-- wp:html -->\n<h2>A imponente sede do casarão foi construída em 1860</h2>                   <p>                A Fazenda Vila Rica desenvolveu-se durante o Ciclo do Café, na região de Itatiba, a apenas 70 Km de São Paulo. O paisagismo é a primeira surpresa de quem chega à Vila Rica. Ao se abrir a entrada principal da Fazenda, somos recebidos por uma alameda rodeada em toda sua extensão por um bosque de árvores, arbustos e vegetação rasteira autenticamente brasileira.            </p>            <p>                 A imponente sede do casarão foi construída em 1860, tem à sua frente um jardim margeando a piscina, e é rodeado por antigos terreiros para a secagem dos grãos de café, com majestosas palmeiras imperiais. Passeando por seus encantadores jardins encontramos uma autêntica capela colonial, estátuas e pórticos portugueses e italianos, trabalhos em pedras formando escadarias, muretas e alamedas que remontam a maneira de viver no auge do Ciclo do Café.            </p>\n            <h2>A Sede segue os parâmetros da arquitetura colonial portuguesa</h2>            <p>                Tendo sido construída a meia encosta, aproveitando o declive do terreno, com alicerce de pedra e paredes grossas de taipa de pilão e piso entre os andares de tábuas de cedro apoiadas em barrotes de peroba e teto com vigas de madeira. No andar inferior o porão era no século XIX um grande depósito usado para armazenagem de sacaria, utensílios de lavoura e como estábulo de animais, que ajudavam a aquecer os ambientes no inverno.            </p>            <p>                Sucessivas reformas foram feitas sempre respeitando a arquitetura original, conservando as fachadas externas, o piso em tábuas largas, assim como a caixilharia de madeira das janelas . A maior restauração da Sede foi feita na década de 40, e abriu janelas onde antes eram alcovas, tendo sido contratado artesões italianos que fizeram pinturas nos forros e batentes.            </p>            <p>            A Sede, por si só, segreda maravilhas, muitas delas insondáveis ao visitante que chega distraído, mas os mistérios da Vila Rica acabam se revelando, seja num objeto, no aconchego de um ambiente, no passeio pelos arredores, na conversa junto à lareira.            Vastíssimo é o acervo da casa, embelezado por mobiliário dos séculos XVIII e XIX, como um arcaz em jacarandá, típico de sacristia de igrejas coloniais brasileiras, autênticas cadeiras entalhadas, aparelho de jantar Limoges, lustres franceses e quadros vitorianos. Junto à Sede há um sino brasonado com armas imperiais que era usado para anunciar as várias atividades do dia, missas, procissões e festas na colônia.             </p>\n<!-- /wp:html -->', 'A Fazenda', '', 'inherit', 'closed', 'closed', '', '50-revision-v1', '', '', '2020-01-06 16:50:32', '2020-01-06 19:50:32', '', 50, 'http://localhost:8090/FRONTDEZ/vilarica/50-revision-v1/', 0, 'revision', '', 0),
